    fetch('/check')
        .then(r =>{

            return r.json()
        })
        .then(resp => {
            console.log(resp)
            setisLoggedIn(true)
        })

    let logoutHandler = () => {
        fetch('/logout', {
            method: 'DELETE'
        })
    }

    return (
        <div>
            Account
            <br></br>
            {isLoggedIn? 'Logged in!' : 'Not Logged in!'}
            <br></br>
            <button onClick={logoutHandler}>Log Out</button>
        </div>
    )

}

